inverse_bit_memo = {}
inverse_bits = {'1': '0', '0': '1'}
is_awesome_memo = {}
compensate_bits_list_memo = {}


def inverse_bit_at(s, i):
    key = f'{s}{i}'
    if key in inverse_bit_memo:
        return inverse_bit_memo[key]
    if i == 0:
        result = f'{inverse_bits[s[0]]}{s[1:]}'
    elif i == 9:
        result = f'{s[0:-1]}{inverse_bits[s[-1]]}'
    else:
        result = f'{s[0:i]}{inverse_bits[s[i]]}{s[i + 1:]}'
    inverse_bit_memo[key] = result
    return result


def compensate_bits_list(bits):
    if bits in compensate_bits_list_memo:
        return compensate_bits_list_memo[bits]
    result = []
    for i in range(10):
        new_bit = inverse_bit_at(bits, i)
        result.append(new_bit)
    compensate_bits_list_memo[bits] = result
    return result


def is_awesome(s):
    if s in is_awesome_memo:
        return is_awesome_memo[s]
    odd_count = 0
    for s_value in list(s):
        if s_value == '1':
            odd_count += 1
            if odd_count > 1:
                is_awesome_memo[s] = False
                return False
    is_awesome_memo[s] = True
    return True


class Solution:
    def longestAwesome(self, s: str) -> int:
        len_s = len(s)
        bit_zero = '0000000000'
        bits_first_index = {bit_zero: 0}
        bits_last_index = {bit_zero: 0}
        target_bits = bit_zero
        for i in range(1, len_s + 1):
            target_bits = inverse_bit_at(target_bits, int(s[i - 1]))
            if target_bits not in bits_first_index:
                bits_first_index[target_bits] = i
            bits_last_index[target_bits] = i

        if is_awesome(target_bits):
            return len(s)

        result = 0
        for target_bits in bits_first_index:
            i = bits_first_index[target_bits]
            for compensate_bits in compensate_bits_list(target_bits):
                if compensate_bits in bits_last_index:
                    result = max(result, bits_last_index[compensate_bits] - i)

        return result


print(Solution().longestAwesome('373781') == 5)
print(Solution().longestAwesome('3242415') == 5)
print(Solution().longestAwesome('12345678') == 1)
print(Solution().longestAwesome(
    '') == 6)

